$.promotion = $.promotion || {};
$.promotion.settings = {
	ssn: 368,
	srl: 13010,
	srl_dev: 1801,
	channel: "P",
	debug: false,
	sub: false,
	json: "../js/promotion.json"
};
$.promotion.init = function () {
	if (!$.promotion.settings.debug) {
		var e = $(window.location.hostname).selector;
		if (e.search(/bugs\.co\.kr/g) > 0) {
			$.promotion.settings.channel = "B";
		} else if (e.search(/cyworld\.com/g) > 0) {
			$.promotion.settings.channel = "CM";
		} else if (e.search(/naver\.com/g) > 0) {
			$.promotion.settings.channel = "PN";
		} else if (e.search(/daum\.net/g) > 0) {
			$.promotion.settings.channel = "D";
		} else {
			$.promotion.settings.channel = "P";
		};
		try {
			if (pmangpub.title.search(/dev|dq/g) > 0) {
				$.promotion.settings.srl = $.promotion.settings.srl_dev;
			};
		} catch (t) {};
	};
};

$.promotion.make = function (e) {
	return $.each(e.promotion.item, function (i, v) {
		$.promotion.data = $.promotion.data || {};
		$.promotion.data[i] = $.promotion.data[i] || {};
		if ($.promotion.settings.sub) {
			$.promotion.data[i].m_img = v.s_img;
		} else {
			$.promotion.data[i].m_img = v.m_img;
		};
		$.promotion.data[i].extra1 = v.extra1;
		$.promotion.data[i].url = v.url;
		$.promotion.data[i].target = v.target;
		$.promotion.data[i].title = v.title;
		$.promotion.data[i].contents = v.contents;
	});
};
	
$.promotion.run = function (func) {
	if ($.promotion.settings.debug) {
		$.getJSON($.promotion.settings.json, function (e) {
			$.promotion.make(e);
			if ($.isFunction(func)) {
				func($.promotion.data)
			}
		});
	} else {
		$.promotion.init();
		gamepub.getPromotionBanner($.promotion.settings.ssn, $.promotion.settings.srl, $.promotion.settings.channel, function (json) {
			json = eval("(" + json + ")");
			$.promotion.make(json);
			if ($.isFunction(func)) {
				func($.promotion.data)
			}
		})
	}
};

/*   slideshow */
$.fn.slideshow = function(options){
	var settings = $.extend({
		list			: 'list',
		nav				: 'nav',
		prev			: 'btn_prev',
		next			: 'btn_next',
		item			: 'node', // li prefix class
		active			: 'on', // active class
		focus			: 'click', // click, hover, focus
		effect			: 'fade', // slide, fade, none
		easing			: 'easeOutCubic',
		start			: 1,
		speed			: 300,
		time			: 4000,
		display			: 1,
		control			: true, // prev, next
		reverse			: false,
		xml				: null,
		on				: 'on'
	}, options);
	$.ndl = [];
	return this.each(function(er){
		$.ndl[er] = $.ndl[er] || {
			selector		: $(this),
			init			: function(){
								$($.ndl[er].selector)
								.append('<div class="'+settings.list+'"><ul /></div>')
								.append('<p class="'+settings.nav+'" />');
							},
			control			: function(){
								if(settings.control==true) {
									$($.ndl[er].selector)
										.prepend('<a class="'+settings.prev+'"/><a class="'+settings.next+'"/>');
								};
							},
			ring			: function(){
								this.li().each(function(idx){
									$(this).addClass(settings.item+(idx+1));
								});
								$($.ndl[er].selector).children('p:first').find('a').each(function(idx){
									$(this).addClass(settings.item+(idx+1));
								});
							},
			print			: function(n,i1,u,t){
								this.n = n, this.i1 = i1, this.u = 'href="'+u+'"', this.t = 'target="'+t+'"';
								if(u=='#'||!u) { this.u = '', this.t = ''; };
								this.append = function(){
									$('<li><a '+this.u+' '+this.t+'><img src="'+this.i1+'" alt="" /></a></li>')
										.appendTo($($.ndl[er].selector).find('div.'+settings.list+' ul'));
									$('<a><span>'+(this.n+1)+'</span></a>')
										.appendTo($($.ndl[er].selector).find('p.'+settings.nav));
								};
							},
			parse			: function(xml){
								this.init();
								this.control();
								$.each(xml,function(i,b) {
									var node = new $.ndl[er].print(i, b.m_img, b.url, b.target);
									node.append();
								});
								this.ring();
								this.play();
							},
			extend			: function(option){
								$.extend(settings, option);
							},
			div				: function(){ return $($.ndl[er].selector).find('div.'+settings.list); },
			width			: function(){ return $.ndl[er].div().find('li').eq(0).width(); },
			height			: function(){ return $.ndl[er].div().find('li').eq(0).height(); },
			ul				: function(){ return $.ndl[er].div().find('ul'); },
			li				: function(){ return $.ndl[er].div().find('li'); },
			total			: function(){ return $.ndl[er].li().length; },
			clone			: function(){ return settings.display-1; },
			slide			: function(){
								var move = this.width()*(settings.start-1);
								$.ndl[er].ul().stop().animate({left:-move},1000,settings.easing);
							},
			fade			: function(){
								var move = $.ndl[er].width()*(settings.start-1);
								$.ndl[er].ul().hide().css('left',-move).stop().fadeIn(500,settings.easing,function(){$(this).css('opacity',1);});
							},
			none			: function(){
								var move = this.width()*(settings.start-1);
								$.ndl[er].ul().stop().css('left',-move);
							},
			action			: function(dir){
								if(dir=='prev') {
									settings.start -= 1;
									if(settings.start<=0) { 
										settings.start = $.ndl[er].total()-($.ndl[er].clone()); 
									};
									$.ndl[er].eq = settings.start-1;
								} else if(dir=='next') { 
									settings.start += 1;
									if(settings.start>$.ndl[er].total()-$.ndl[er].clone()) { 
										settings.start = 1; 
									};
								};
								eval('$.ndl[er].'+settings.effect+'();');
								$.ndl[er].on();
							},
			on				: function(){
								$($.ndl[er].selector).find('p.'+settings.nav)
									.find('a > b > span').unwrap().end()
									.find('a:eq('+(settings.start-1)+') span').wrap('<b class="'+settings.on+'" />');
							},
			interval		: {
								data	: {},
								start	: function() { if(settings.reverse==false) { var derection = 'next'; } else { var derection = 'prev'; }; return $.ndl[er].interval.data = setInterval(function(){ $.ndl[er].action(derection); }, settings.time); },
								stop	: function() { return clearInterval($.ndl[er].interval.data); }
							},
			play			: function(){
								this.ring();
								var n = settings.start-1;
								if($.ndl[er].total()>0) {
									if($.ndl[er].clone()>=0) {
										$.ndl[er].ul()
											.width((($.ndl[er].total()+$.ndl[er].clone())*$.ndl[er].width())+3)
											.css('overflow','hidden')
											.find('li:lt('+$.ndl[er].clone()+')').clone()
											.appendTo($.ndl[er].ul());
										$.ndl[er].div().width(settings.display*$.ndl[er].width());
									} else {
										$.ndl[er].ul()
											.width(($.ndl[er].total()*$.ndl[er].width())+3)
											.css('left',-$.ndl[er].width()*n);
										$.ndl[er].div().width($.ndl[er].width());
									};
									if(settings.control==true) {
										$($.ndl[er].selector).find('a.btn_prev').bind('click',function(){
											$.ndl[er].action('prev');
										});
										$($.ndl[er].selector).find('a.btn_next').bind('click',function(){
											$.ndl[er].action('next');
										});
									};
									$($.ndl[er].selector).find('p.'+settings.nav+' a').bind(settings.focus,function(){
										if(settings.start!==$(this).attr('class').replace(settings.item,'')*1) {
											settings.start = $(this).attr('class').replace(settings.item,'')*1;
											$.ndl[er].action(settings.start);
										};
									});
									$($.ndl[er].selector)
										.bind('mouseenter',function(){$.ndl[er].interval.stop();})
										.bind('mouseleave',function(){$.ndl[er].interval.start();});
									$.ndl[er].action(settings.start);
									$.ndl[er].interval.start();
								} else {
									return false;
								};
							}
		};
		if(settings.xml) {
			$.ndl[er].parse(settings.xml);
		} else {
			$.ndl[er].control();
			$.ndl[er].play();
			$('.sales .nav a').bind('mouseenter',function(){
				var span = $(this).find('span:first');
				span.stop().animate({'margin-top':-3,height:14},50,'easeOutBack').animate({'margin-top':0,height:8},300,'easeOutQuint');
			});
		};
	});
};

